import React from 'react';


function Review(props) {
    function rating (num) {
        var i;
        for (i=0; i<=num; i++) {
            print("*");
        }
    }
    return (
        <span>Name: {props.number} Rate: {rating(props.stars)} </span>
    );
}

export default Review;
